import React from 'react';
import logo from './logo.svg';
import { Counter } from './features/counter/Counter';
// import { Upgrade } from './features/upgrade/Upgrade';
import {marauder} from "./SC2Data"
import './App.css';

function App() {
  // const upgrades = ["/attack.png", "/shield.png", "/armor.png"].map((item, id) => {
  //   return <Upgrade key={id} src={item}/>
  // })

  const Unit = ({type}) => {
    return <>Unit</>
  }

  const Upgrade = ({researchKind, value})=> {
    return <>Upgrade</>
  }

  const Attacker = () => {
    return <>
      <Unit type={marauder} />
      <Upgrade researchKind={"attack"} value={marauder.base.armor} />
    </>
  }

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Attacker />

        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <span>
          <span>Learn </span>
          <a
            className="App-link"
            href="https://reactjs.org/"
            target="_blank"
            rel="noopener noreferrer"
          >
            React
          </a>
          <span>, </span>
          <a
            className="App-link"
            href="https://redux.js.org/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Redux
          </a>
          <span>, </span>
          <a
            className="App-link"
            href="https://redux-toolkit.js.org/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Redux Toolkit
          </a>
          ,<span> and </span>
          <a
            className="App-link"
            href="https://react-redux.js.org/"
            target="_blank"
            rel="noopener noreferrer"
          >
            React Redux
          </a>
        </span>
      </header>
    </div>
  );
}

export default App;
